import { GridExtension } from "./GridExtension.js";
export class GridExtensionProvider {
  shouldExtend(designItem) {
    if (getComputedStyle(designItem.element).display == 'grid') return true;
    return false;
  }

  getExtension(designerView, designItem) {
    return new GridExtension(designerView, designItem);
  }

}